import React , { Component} from 'react';
import {  Card, Button, CardHeader, CardFooter, CardBody, CardTitle, CardText,Form, FormGroup, Label, Input, FormText } from 'reactstrap';
import { PieChart, Pie, Sector, Cell, ResponsiveContainer } from 'recharts';
const data01 = [
    { name: 'Group A', value: 400 },
    { name: 'Group B', value: 300 },
    { name: 'Group C', value: 300 },
    { name: 'Group D', value: 200 },
    { name: 'Group E', value: 278 },
    { name: 'Group F', value: 189 },
  ];
class Visuals extends Component {
    render() {
        return(
                <div className='container'>
                <div className="col-12 col-md-5 m-1">
                <Card color='secondary' style={{width:"50rem",height:"28rem"}}>
                    <CardBody>
                <ResponsiveContainer width="100%" height="100%">
                <PieChart width={600} height={600}>
                <Pie data={data01} dataKey="value" cx="50%" cy="50%" outerRadius={100} fill="#8884d8" />
                </PieChart>
                </ResponsiveContainer>
                </CardBody>
                </Card>
                </div>
                </div>
            )
    }
}

export default Visuals;
